import React, { useState,useEffect } from 'react';
import Popup from '../../components/Popup';
import Navbar from "../../components/navbar/navbar";
import axios from "axios"





function Pop() {
  const [Projects, setProjects] = useState ([]);
  useEffect(() => {  
    axios
    .get("http://localhost:5003/project/")
    .then((response) => {
      console.log(response.data)
      setProjects( response.data );
    })
    .catch((error) => {
      console.log(error);
    });
  },[]);



  return(   

Projects &&
  Projects.map((item, index) => {

  <div>
    <Navbar/>

    <div class="container"  >
  <div class="card-column column-0">
    <div class="card card-color-0">
      <div class="border"></div>
      <img  src={`http://localhost:5003/project/projects/uploads/${item.image}`} />
      <h1>{item}</h1>
    </div>

  </div>
</div>

<div id="cover" class="cover"></div>

<div id="open-content" class="open-content">
  <a href="#" id="close-content" class="close-content"><span class="x-1"></span><span class="x-2"></span></a>
  <img id="open-content-image" src="" />
  <div class="text" id="open-content-text">
  </div>
</div>


  </div>
  }
))
  }
export default Pop;
